vec4 dequantize(uint val, vec4 mi, vec4 ma)
{
    vec4 res = vec4(float(val & 0xFFu), float((val >> 8u) & 0xFFu), float((val >> 16u) & 0xFFu), float((val >> 24u) & 0xFFu));
    return res * (ma - mi) / 255.0 + mi;
}

int get_index(ivec3 p)
{
    return (p.x + (p.y + p.z*embed_size.y)*embed_size.x)/4;
}

int get_vec_index(ivec3 p)
{
    return (p.x + (p.y + p.z*embed_size.y)*embed_size.x)%4;
}

ivec3 get_coord(vec2 fragCoord)
{
    ivec2 p = ivec2(fragCoord);
    ivec2 pxy = p % (embed_size.xy + 2);
    int pz = p.x / (embed_size.x + 2);
    return ivec3(pxy.x, pxy.y, pz);
}

bool is_outside(ivec3 p)
{
    return p.x < 0 || p.y < 0 || p.z < 0 || p.x >= embed_size.x + 2 || p.y >= embed_size.y + 2 || p.z >= embed_size.z + 2;
}

bool is_edge(ivec3 p)
{
    return p.x == 0 || p.y == 0 || p.z == 0 || p.x == embed_size.x + 1 || p.y == embed_size.y + 1 || p.z == embed_size.z + 1;
}

#define get_embed(embed_name, embed_number, p) dequantize(embed_name[get_index(p)][get_vec_index(p)], embed_quant_min[embed_number], embed_quant_max[embed_number])

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec3 p = get_coord(fragCoord);

    if(is_outside(p) || iFrame > 8) discard;

    if(is_edge(p))
    {
        fragColor = vec4(0.0);
    }
    else
    {
        fragColor = get_embed(embed_quant_2, 2, p-1);
    }
}

